import React from "react";
import "./Login.css";
import { Link } from "react-router-dom";

function Login() {
  return (
    <div className="login">
      <Link to="/">
        <img
          className="login_logo"
          src="https://i.insider.com/539f3ffbecad044276726c01?width=1100&format=jpeg&auto=webp"
          alt=""
        />
      </Link>

      <div className="login_container">
          <h1>Sign-in</h1>   
          <form>
              <h5>E-mail</h5>
              <input type="text" />
              
              <h5>Password</h5>
              <input type="password" />

                <button>Sign In</button>
              </form>  

              <p>By continuing, you agree to Amazon's fake clobConditions of Use and Privacy Notice.</p> 
          </div>
    </div>
  );
}

export default Login;
